import { useEffect, useState } from 'react'
import { useCookies } from 'react-cookie'
import axios from 'axios'
import Nav from '../components/Nav'
import {Link} from 'react-router-dom'


const MyPlaces = ({saved_places}) => {
  const [cookies] = useCookies(['userId'])
  const [savedPlacesIds, setSavedPlaces] = useState([])
  const userId = cookies.UserId

  useEffect(() => {
    const fetchSavedPlaces = async () => {
      try { 
        console.log("fetching saved places for userID:", userId)
        const response = await axios.get(`http://localhost:8000/save-places?userId=${userId}`)
        const data = response.data
        console.log("Response data:", data)
        setSavedPlaces(response.data)
      } catch (error) {
        console.error('Error fetching saved places:', error)
      }
    }

    fetchSavedPlaces()
  }, [])



  return (
    <div>
      <div className="placeList">

        <Nav />

          <div className="heroImg">

            <h1>My Saved Places</h1>
          </div>
          <h3>Now that you've met your match, plan a fun, dog-friendly date!</h3>
          <h4><Link to="/placesubmit">Don't see anything? Find a place to save to your list.</Link></h4>
          <h4>Know a great place? Submit one here.</h4>
          <span>Be sure to follow basic dating tips.</span>
          <ul>
            {savedPlacesIds.map((place) => (
              <li key={place._id}>
                <h3>{place.place_name}</h3>
                <p>{place.place_street}</p>
                <p>
                  {place.place_city}, {place.place_state} {place.place_zip}
                </p>
                <a href={place.place_url}>Website</a>
                <p>{place.place_about}</p>
              </li>
            ))}
          </ul>
      </div>
    </div>
  );
};

export default MyPlaces


